-- ----------------------------
-- Procedure structure for GETMAXNUM
-- ----------------------------
DROP PROCEDURE [dbo].[GETMAXNUM]
GO


-- =============================================
-- Author:		htfengjia 
-- Create date: 2018-1-29
-- Description:	获取最大单据编号
-- =============================================
CREATE PROCEDURE [dbo].[GETMAXNUM] @NOTYPE VARCHAR(40),@FBILLNO VARCHAR(40) OUTPUT
AS
BEGIN
	SET NOCOUNT ON;
	DECLARE @BILLTYPE VARCHAR(40),@NUM INT
    SELECT @BILLTYPE=VALUE FROM LJL_BILLNOS
      WHERE ID=1 AND NOTYPE=@NOTYPE
    SELECT @NUM=CAST (VALUE AS INT) FROM LJL_BILLNOS
      WHERE ID=2 AND NOTYPE=@NOTYPE

    update LJL_BILLNOS set VALUE=right('00000000'+cast(@NUM+1 as varchar),8) 
        where ID=2 AND NOTYPE=@NOTYPE

    select @FBILLNO= @BILLTYPE+right('00000000'+cast(@NUM+1 as varchar),8)
    
END



GO

-- ----------------------------
-- Procedure structure for p_AlterColumn
-- ----------------------------
DROP PROCEDURE [dbo].[p_AlterColumn]
GO


CREATE PROCEDURE [dbo].[p_AlterColumn]
@TableName        VARCHAR(50),
@ColumnName       VARCHAR(50),
@ColumnType       VARCHAR(50),  --ModifyFlag='1000' ColumnType = 'NULL' 表示删除
@ColumnIsNull     VARCHAR(10),
@ModifyFlag       VARCHAR(10),  --数据类型，精度，为空，缺省值分别占1位。改了缺省值和精度该值为：'0101'
@DefaultValue VARCHAR(255) = NULL
AS
SET NOCOUNT ON
DECLARE @DefaultName VARCHAR(255)
DECLARE @DefaultValueSQL VARCHAR(2000)
DECLARE @IndexName     SYSNAME
DECLARE @FieldName     SYSNAME
DECLARE @PrevIndexName SYSNAME
DEClARE @IsPrimaryKey  INT
DECLARE @ColumnID      SMALLINT
DECLARE @Clustered     VARCHAR(15)
DECLARE @DropSQL       VARCHAR(8000)
DECLARE @CreateSQL     VARCHAR(8000)
IF @ColumnType = 'BLOB'
BEGIN
SET @ColumnType = 'IMAGE'
END
ELSE IF @ColumnType = 'NCLOB'
BEGIN
SET @ColumnType = 'NTEXT'
END
ELSE IF @ColumnType = 'XMLTYPE'
BEGIN
SET @ColumnType = 'XML'
END
SET @DefaultValueSQL = ''
IF SUBSTRING(@ModifyFlag,4,1) = '1'	--修改缺省值
BEGIN
SELECT @DefaultName = ISNULL(object_name(o.constid), '')
FROM sysconstraints O
INNER JOIN syscolumns C ON O.ID = C.id AND O.colid = C.colid
WHERE O.ID = OBJECT_ID(@TableName) AND C.name = @ColumnName
IF LEN(@DefaultName) > 0
BEGIN
EXECUTE('ALTER TABLE ' + @TableName + ' DROP CONSTRAINT ' + @DefaultName)
END
ELSE
BEGIN  --无记录是为null，LEN(NULL)>0为false
SELECT @DefaultName = 'DF_' + @TableName + '_' + @ColumnName
END
IF @DefaultValue IS NOT NULL AND @DefaultValue <> 'NULL'	--isnull表示删除
BEGIN
IF LEFT(@DefaultValue, 3) = '{ts'
BEGIN
SET @DefaultValue = REPLACE(REPLACE(@DefaultValue, '{ts', ''), '}', '')
END
SET @DefaultValueSQL ='ALTER TABLE ' + @TableName + ' ADD  CONSTRAINT ' + @DefaultName + ' DEFAULT ('
+ @DefaultValue + ') FOR ' + @ColumnName
END
END		--SUBSTRING(@ModifyFlag,4,1) = '1'	--修改缺省值
IF (SUBSTRING(@ModifyFlag,3,1) = '1' AND UPPER(@ColumnIsNull) = 'NOT NULL') or (SUBSTRING(@ModifyFlag,1,1) = '1') or (SUBSTRING(@ModifyFlag,2,1) = '1')
BEGIN
SELECT @DropSQL = '', @PrevIndexName = '', @CreateSQL = '', @IsPrimaryKey = 0
SELECT @ColumnID = colid
FROM syscolumns
WHERE name = @ColumnName AND id = OBJECT_ID(@TableName)
DECLARE curIndexes CURSOR FOR
SELECT i.name AS IndexName, c.name AS FieldName, CASE WHEN o.id IS NULL THEN 0
ELSE OBJECTPROPERTY(o.id, 'IsPrimaryKey')
END AS IsPrimaryKey,
CASE i.indid WHEN 1 THEN ' CLUSTERED '
ELSE ' NONCLUSTERED '
END AS IsClustered
FROM sysindexes i
INNER JOIN sysindexkeys k ON i.id = k.id AND i.indid = k.indid
INNER JOIN syscolumns c ON i.id = c.id AND c.colid = k.colid
LEFT JOIN sysobjects o ON o.id = OBJECT_ID(i.name)
WHERE i.id = OBJECT_ID(@TableName) AND INDEXPROPERTY(i.id, i.name, 'IsAutoStatistics') <> 1
AND i.indid IN (SELECT indid
FROM sysindexkeys
WHERE id = k.id AND colid = @ColumnID)
ORDER BY i.indid
OPEN curIndexes
FETCH NEXT FROM curIndexes INTO @IndexName, @FieldName, @IsPrimaryKey, @Clustered
WHILE(@@FETCH_STATUS = 0)
BEGIN
IF @PrevIndexName <> @IndexName
BEGIN
IF @IsPrimaryKey = 0
BEGIN
SELECT @DropSQL = @DropSQL + 'DROP INDEX ' + @TableName + '.' + @IndexName + CHAR(10)
IF @CreateSQL = ''
SELECT @CreateSQL = 'CREATE' + @Clustered + 'INDEX ' + @IndexName + ' ON ' + @TableName + ' (' + @FieldName
ELSE
SELECT @CreateSQL = @CreateSQL + ')' + CHAR(10) + 'CREATE' + @Clustered + 'INDEX ' + @IndexName + ' ON ' + @TableName + ' (' + @FieldName
END
ELSE
BEGIN
SELECT @DropSQL = @DropSQL + 'ALTER TABLE ' + @TableName + ' DROP CONSTRAINT ' + @IndexName + CHAR(10)
IF @CreateSQL = ''
SELECT @CreateSQL = 'ALTER TABLE ' + @TableName + ' ADD CONSTRAINT ' + @IndexName + ' PRIMARY KEY' + @Clustered + '(' + @FieldName
ELSE
SELECT @CreateSQL = @CreateSQL + ')' + CHAR(10) + 'ALTER TABLE ' + @TableName + ' ADD CONSTRAINT ' + @IndexName + ' PRIMARY KEY' + @Clustered + '(' + @FieldName
END
SELECT @PrevIndexName = @IndexName
END
ELSE
BEGIN
SELECT @CreateSQL = @CreateSQL + ',' + @FieldName
END
FETCH NEXT FROM curIndexes INTO @IndexName, @FieldName, @IsPrimaryKey, @Clustered
END
CLOSE curIndexes
DEALLOCATE curIndexes
IF @CreateSQL <> ''
SELECT @CreateSQL = @CreateSQL + ')'
EXECUTE (@DropSQL)
END
IF @ColumnType = '' OR @ColumnType = 'NULL'
BEGIN
EXECUTE ('ALTER TABLE ' + @TableName + ' DROP COLUMN ' + @ColumnName + ' ')
END
ELSE
BEGIN
IF(SUBSTRING(@ModifyFlag,1,1) = '1') --修改类型
BEGIN
EXECUTE ('ALTER TABLE ' + @TableName + ' ALTER COLUMN ' + @ColumnName + ' ' + @ColumnType + ' ' + @ColumnIsNull + ' ')
IF (SUBSTRING(@ModifyFlag,3,1) = '1' AND @ColumnIsNull = 'NOT NULL' )	--“是否为空”有null修改为notnull，必须要有缺省值
BEGIN
EXECUTE('UPDATE ' + @TableName + ' SET ' + @ColumnName + ' = ' + @DefaultValue + ' WHERE ' + @ColumnName + ' IS NULL ' )
END
END
ELSE  -- 如果修改了精度、为空
BEGIN
IF (SUBSTRING(@ModifyFlag,3,1) = '1' AND @ColumnIsNull = 'NOT NULL' )	--“是否为空”有null修改为notnull，必须要有缺省值
BEGIN
EXECUTE('UPDATE ' + @TableName + ' SET ' + @ColumnName + ' = ' + @DefaultValue + ' WHERE ' + @ColumnName + ' IS NULL ' )
END
IF (SUBSTRING(@ModifyFlag,2,1) = '1' OR SUBSTRING(@ModifyFlag,3,1) = '1')	--修改了精度和为空才执行，只修改缺省值不执行
BEGIN
EXECUTE ('ALTER TABLE ' + @TableName + ' ALTER COLUMN ' + @ColumnName + ' ' + @ColumnType + ' ' + @ColumnIsNull + ' ')
END
END
IF @DefaultValueSQL <> ''
BEGIN
EXECUTE (@DefaultValueSQL)
END
IF @CreateSQL <> ''
BEGIN
EXECUTE (@CreateSQL)
END
END



GO

-- ----------------------------
-- Procedure structure for p_AlterPK
-- ----------------------------
DROP PROCEDURE [dbo].[p_AlterPK]
GO


CREATE PROCEDURE [dbo].[p_AlterPK](@PkName VARCHAR(30),
@TableName VARCHAR(30),
@FieldName VARCHAR(2000),
@IsClustered INT = 0)	--0非聚集   1聚集
AS
SET NOCOUNT ON
DECLARE @oldPkName VARCHAR(30)
DECLARE @strCluster VARCHAR(20)
DECLARE @clusterIndexName VARCHAR(100)
SELECT @oldPkName = name FROM sys.objects WHERE parent_object_id = object_id(@TableName) AND type='PK'
IF(LEN(@oldPkName)>0)
BEGIN
EXEC('ALTER TABLE ' + @TableName + ' DROP CONSTRAINT '+ @oldPkName)
END
SELECT @clusterIndexName = @TableName + '.' + name from sys.indexes where object_id = object_id(@TableName) and index_id = 1
SET @strCluster = ' NONCLUSTERED '
IF @IsClustered=1	--删除聚集索引
BEGIN
SET @strCluster = ' CLUSTERED '
IF(len(@clusterIndexName) > 0)
BEGIN
EXEC(' DROP INDEX '  + @clusterIndexName)	--删除聚集索引
END
END
IF(LEN(@FieldName)>0)
BEGIN
EXEC('ALTER TABLE ' + @TableName + ' ADD CONSTRAINT ' + @PkName + ' PRIMARY KEY ' + @strCluster + '(' + @FieldName + ')')
END



GO

-- ----------------------------
-- Procedure structure for p_ModifyObjectName
-- ----------------------------
DROP PROCEDURE [dbo].[p_ModifyObjectName]
GO


CREATE PROCEDURE [dbo].[p_ModifyObjectName]
@TableName		VARCHAR(50),
@ObjectName		VARCHAR(50),
@NewObjectName	VARCHAR(50),
@ObjectType		VARCHAR(10),		--'OBJECT': 表    'COLUMN': 列
@FieldType		VARCHAR(1000) = ''
AS
BEGIN
IF @ObjectType = 'OBJECT' AND EXISTS (select top 1 1 from sys.objects where object_id = OBJECT_ID(@ObjectName))
BEGIN
EXECUTE('sp_rename N''' + @ObjectName + ''', N'''+ @NewObjectName + ''', N''OBJECT'' ')
END
ELSE IF @ObjectType = 'COLUMN' AND EXISTS (select top 1 1 from sys.columns where object_id = OBJECT_ID(@TableName) AND column_id = OBJECT_ID(@ObjectName))
BEGIN
EXECUTE('sp_rename N''' + @TableName + '.' + @ObjectName + ''', N'''+ @NewObjectName + ''', N''COLUMN'' ')
END
END



GO

