-- Procedure structure for PROC_BI_DATE
-- ----------------------------
DROP PROCEDURE [dbo].[PROC_BI_DATE]
GO


CREATE PROCEDURE [dbo].[PROC_BI_DATE]
AS
truncate table T_BI_DATE
truncate table T_BI_PERIOD
declare @ny int,@mny int
set @ny=(select CONVERT(varchar(100),MIN(FSTARTDATE), 112)  from t_bd_accountcalendar)
set @mny=CONVERT(varchar(100), GETDATE(), 112)
while @ny<=@mny
begin
insert into T_BI_DATE select  cast(cast(@ny  as varchar) as datetime)
set @ny=cast(replace(convert(varchar(100),dateadd(day,1,cast(cast(@ny  as varchar) as datetime)),23),'-','') as int)
end
Insert into T_BI_PERIOD(FPERIOD,FYEAR,FMONTH)
select fdate, YEAR(fdate),month(fdate)
from  T_BI_DATE where day(fdate)=1


GO

