-- ----------------------------
-- Function structure for FN_GCD
-- ----------------------------
DROP FUNCTION [dbo].[FN_GCD]
GO


CREATE  FUNCTION [dbo].[FN_GCD](@num1 decimal(23,10),@num2 decimal(23,10))
RETURNS decimal(23,10)
AS
BEGIN
DECLARE @m decimal(23,10)
DECLARE @i decimal(23,10)
DECLARE @ret decimal(23,10)
if(@num1<=0 or @num2<=0)
begin
return 1
end
if(@num1<@num2)
BEGIN
SET  @m = @num2
SET  @num2 = @num1
SET  @num1 = @m
END
SET @i=@num1%@num2
WHILE @i>0
BEGIN
select @num1=@num2,@num2=@i,@i=@num1%@num2
END
return @num2
END



GO

-- ----------------------------
-- Function structure for FN_LCM
-- ----------------------------
DROP FUNCTION [dbo].[FN_LCM]
GO


CREATE  FUNCTION [dbo].[FN_LCM](@num1 decimal(23,10),@num2 decimal(23,10))
RETURNS decimal(23,10)
AS
BEGIN
DECLARE @a decimal(23,10)
DECLARE @b decimal(23,10)
DECLARE @c decimal(23,10)
DECLARE @d decimal(23,10)
SET  @a = @num1
SET  @b = @num2
SET  @c = dbo.FN_GCD (@num1,@num2)
SET  @d = @a*@b/@c
RETURN @d
END



GO

